import React from 'react';
import Footer from './elements/footer';
import Dashboard from './protected/dashboard'
import Register from './unprotected/register';
import Login from './unprotected/login';
import Navigation from './elements/navigation';
import CV from './protected/cv';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams,
  Redirect
} from "react-router-dom";
import { ProtectedRoute } from "./protected.route";
import { PreparedRoute } from "./prepared.route";

const ProtectedLayout =({children}) =>{
    return(
        <>
        <div>
            <Navigation/>
                <Switch>
                    <Route exact path='/app/login' component={Login} />
                    <Route exact path='/app/register' component={Register} />     
                    <ProtectedRoute exact path="/app/dashboard" component={Dashboard} />
                    <Route path="/cv"  component={CV}/>
                    <Route path="/skills"  component={Login}/>
                    <Route path="/profile"  component={Login}/>
                    <Route path="/entity"  component={Login}/>                        
                </Switch>

        </div>
        <main>{children}</main>
        </>
    )
}

export default ProtectedLayout;
